import React, { Component } from 'react'

class ChronoTime extends React.Component
{

    state = {        
        min: 1,
        sec: 0.0,
        mili: 0.0
    }

    setMili = selectedMili => 
    {
        this.setState({selectedMili});
    };

     render() {
        return (
            <div>
                <InputNumber
                    id='timeMin'
                    min={0}
                    max={9}
                    step={1}
                    value={this.state.min}
                    onChange={(selectedMin) => this.setTrack(selectedMin) }
                />
                <InputNumber
                    id='timeSec'
                    min={0}
                    max={9}
                    step={1}
                    value={this.state.sec}
                    onChange={(selectedSec) => this.setTrack(selectedSec) }
                />
                <InputNumber
                    id='timeMili'
                    min={0}
                    max={9}
                    step={1}
                    value={this.state.mili}
                    onChange={(selectedMili) => this.setTrack(selectedMili) }
                />
            </div>
        );
    }


}

export default ChronoTime;
